import React from 'react';
import { withRouter } from 'react-router';


class Auth extends React.Component {

  constructor(props) {
    super(props);
    console.log('authenticate constructor');
    this.router = withRouter();
  }


  render() {
    return (
      <div>
        {(this.router.query.code)}
      </div>
    );
  }
}

export default Auth;
